  false,\n\t\"url\": null,\n\t\"notes\": \"This report is on a study at Des Lacs National
  Wildlife Refuge and Lostwood National Wildlife Refuge to attempt to understand the
  mechanisms of ecological isolation of five species of grebes in the area.  Habitat
  preference data was gathered for each species to prove that there is a pattern of
  ecological isolation occurring in the area.  General observations on behavior and
  habitat preference are summarized for each species.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
